import styled from "styled-components";

const AboutWrap = styled.article`
  text-align: center;
  display: flex;
  flex-direction: column;
  min-height: calc(100vh - 8rem);
  justify-content: center;
  align-items: center;
  .desc {
    color: var(--gray-color);
    margin-bottom: 2rem;
  }
`;

const About = () => {
  return (
    <AboutWrap>
      <div className="imgWrap" />
      <div className="desc">
        <p>this is about</p>
      </div>
    </AboutWrap>
  );
};
export default About;
